INSERT INTO `personal` (`Personal-Nr`, `Nachname`, `Vorname`, `Position`, `Anrede`, `Geburtsdatum`, `Einstellung`, `Straße`, `Ort`, `Region`, `PLZ`, `Land`, `Telefon privat`, `Durchwahl Büro`, `Foto`, `Bemerkungen`, `Vorgesetzte(r)`) VALUES
  (1,'Davolio','Nancy','Vertriebsmitarbeiterin','Frau','1968-12-08 00:00:00','1992-05-01 00:00:00','507 - 20th Ave. E.\r\nApt. 2A','Seattle','WA','98122','USA','(206) 555-9857','5467','EmpID1.bmp','Studium mit Abschluß BA in Psychologie an der Colorado State University. Kurs \"The Art of the Cold Call.\"  Mitglied des Clubs \"Toastmasters International\".',2),
  (2,'Fuller','Andrew','Geschäftsführer','Herr','1952-02-19 00:00:00','1992-08-14 00:00:00','908 W. Capital Way','Tacoma','WA','98401','USA','(206) 555-9482','3457','EmpID2.bmp','Studium der Betriebswirtschaft an der University of Dallas; Doktorarbeit über Internationales Marketing. Andrew spricht fließend Französisch und Italienisch. Er versteht Deutsch und liest deutsche Zeitungen und Zeitschriften. Eintritt in die Firma als Verkaufsrepräsentant, später Verkaufsleiter, jetzt Geschäftsführer. Mitglied des Sales Management Roundtable und des Verbandes \"Pacific Rim Importers\".',8),
  (3,'Leverling','Janet','Vertriebsmitarbeiterin','Frau','1963-08-30 00:00:00','1992-04-01 00:00:00','722 Moss Bay Blvd.','Kirkland','WA','98033','USA','(206) 555-3412','3355','EmpID3.bmp','Studium mit Abschluß BS in Chemie vom Boston College. Sie hat dort außerdem an dem Kurs \"Betriebsführung und -organisation im Lebensmittel-Einzelhandel\" teilgenommen. Eintritt in die Firma als Verkaufsassistentin. Sie wurde zur Verkaufsrepräsentantin befördert.',8),
  (4,'Peacock','Margaret','Vertriebsmitarbeiterin','Frau','1958-09-19 00:00:00','1993-05-03 00:00:00','4110 Old Redmond Rd.','Redmond','WA','98052','USA','(206) 555-8122','5176','EmpID4.bmp','Studium der Englischen Literatur am Concordia College mit Abschluß BA. Studium am American Institute of Culinary Arts mit Abschluß MA. Margaret arbeitete temporär in der Londoner Abteilung bevor sie nach Seattle kam.',NULL),
  (5,'Buchanan','Steven','Vertriebsmanager','Herr','1955-03-04 00:00:00','1993-10-17 00:00:00','14 Garrett Hill','London',NULL,'SW1 8JR','UK','(71) 555-4848','3453','EmpID5.bmp','Studium an der St. Andrews University, Scotland, mit Abschluß BSC. Eintritt in die Firma als Verkaufsrepräsentant. Steven nahm an einem Orientierungskurs in der Seattle Abteilung teil und kehrte dann auf seinen Posten im Londoner Büro zurück, wo er zum Verkaufsleiter befördert wurde. Steven Buchanan hat an mehreren Weiterbildungskursen teilgenommen, darunter \"Erfolgreiches Telemarketing\" und \"Internationales Verkaufsmanagement\". Er spricht fließend Französisch.',NULL),
  (6,'Suyama','Michael','Vertriebsmitarbeiter','Herr','1963-07-02 00:00:00','1993-10-17 00:00:00','Coventry House\r\nMiner Rd.','London',NULL,'EC2 7JR','UK','(71) 555-7773','428','EmpID6.bmp','Abschlüsse: MA in Wirtschaft (Sussex University) und MBA in Marketing (University of California at Los Angeles). Weiterbildungskurse: Internationale Verkaufsstrategien sowie Zeit-Management für professionelle Verkaufspersonen. Er spricht fließend Japanisch und liest französische, portugiesische und spanische Fachliteratur, Zeitungen und Zeitschriften.',NULL),
  (7,'King','Robert','Vertriebsmitarbeiter','Dr.','1960-05-29 00:00:00','1994-01-02 00:00:00','Edgeham Hollow\r\nWinchester Way','London',NULL,'RG1 9SP','UK','(71) 555-5598','465','EmpID7.bmp','Englischstudium an der University of Michigan.  Vorher war Robert King ein Mitglied der amerikanischen Hilfsorganisation \"Peace Corps\". Dann Eintritt in die Firma. Nach Teilnahme am Kurs: \"Selling in Europe\",  Versetzung in die Londoner Abteilung.',NULL),
  (8,'Callahan','Laura','Vertriebskoordinatorin','Frau','1958-01-09 00:00:00','1994-03-05 00:00:00','4726 - 11th Ave. N.E.','Seattle','WA','98105','USA','(206) 555-1189','2344','EmpID8.bmp','Studium mit Abschluß BA in Psychologie an der University of Washington. Kurs: Geschäftsfranzösisch. Laura liest französische Zeitschriften und Zeitungen.',NULL),
  (9,'Dodsworth','Anne','Vertriebsmitarbeiterin','Frau','1969-07-02 00:00:00','1994-11-15 00:00:00','7 Houndstooth Rd.','London',NULL,'WG2 7LT','UK','(71) 555-4444','452','EmpID9.bmp','Studienabschluß am St. Lawrence College mit BA. Sie spricht fließend Französisch und Deutsch.',NULL);
